@testset "4.3.11 (e x)^m (a+b tan(c+d x^n))^p" begin
    (a, b, c, d, x, ) = @variables a b c d x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*tan(c+d*x^n))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*tan(c+d*x^2))^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^3*(a + b*tan(c + d*x^2)), x, 7, (a*x^4)/4 + (im/4)*b*x^4 - (b*x^2*log(1 + ℯ^((2*im)*(c + d*x^2))))/(2*d) + ((im/4)*b*PolyLog(2, -ℯ^((2*im)*(c + d*x^2))))/d^2]
    @test_int [x^2*(a + b*tan(c + d*x^2)), x, 2, (a*x^3)/3 + b*Unintegrable(x^2*tan(c + d*x^2), x)]
    @test_int [x^1*(a + b*tan(c + d*x^2)), x, 4, (a*x^2)/2 - (b*log(cos(c + d*x^2)))/(2*d)]
    @test_int [a + b*tan(c + d*x^2), x, 1, a*x + b*Unintegrable(tan(c + d*x^2), x)]
    @test_int [(a + b*tan(c + d*x^2))/x^1, x, 2, a*log(x) + b*Unintegrable(tan(c + d*x^2)/x, x)]
    @test_int [(a + b*tan(c + d*x^2))/x^2, x, 2, -(a/x) + b*Unintegrable(tan(c + d*x^2)/x^2, x)]


    @test_int [x^3*(a + b*tan(c + d*x^2))^2, x, 10, (a^2*x^4)/4 + (im/2)*a*b*x^4 - (b^2*x^4)/4 - (a*b*x^2*log(1 + ℯ^((2*im)*(c + d*x^2))))/d + (b^2*log(cos(c + d*x^2)))/(2*d^2) + ((im/2)*a*b*PolyLog(2, -ℯ^((2*im)*(c + d*x^2))))/d^2 + (b^2*x^2*tan(c + d*x^2))/(2*d)]
    @test_int [x^2*(a + b*tan(c + d*x^2))^2, x, 0, Unintegrable(x^2*(a + b*tan(c + d*x^2))^2, x)]
    @test_int [x^1*(a + b*tan(c + d*x^2))^2, x, 3, ((a^2 - b^2)*x^2)/2 - (a*b*log(cos(c + d*x^2)))/d + (b^2*tan(c + d*x^2))/(2*d)]
    @test_int [x^0*(a + b*tan(c + d*x^2))^2, x, 0, Unintegrable((a + b*tan(c + d*x^2))^2, x)]
    @test_int [(a + b*tan(c + d*x^2))^2/x^1, x, 0, Unintegrable((a + b*tan(c + d*x^2))^2/x, x)]
    @test_int [(a + b*tan(c + d*x^2))^2/x^2, x, 0, Unintegrable((a + b*tan(c + d*x^2))^2/x^2, x)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [x^3/(a + b*tan(c + d*x^2)), x, 5, x^4/(4*(a + im*b)) + (b*x^2*log(1 + ((a^2 + b^2)*ℯ^(2*im*(c + d*x^2)))/(a + im*b)^2))/(2*(a^2 + b^2)*d) - (im*b*PolyLog(2, -(((a^2 + b^2)*ℯ^(2*im*(c + d*x^2)))/(a + im*b)^2)))/(4*(a^2 + b^2)*d^2)]
    @test_int [x^2/(a + b*tan(c + d*x^2)), x, 0, Unintegrable(x^2/(a + b*tan(c + d*x^2)), x)]
    @test_int [x^1/(a + b*tan(c + d*x^2)), x, 3, (a*x^2)/(2*(a^2 + b^2)) + (b*log(a*cos(c + d*x^2) + b*sin(c + d*x^2)))/(2*(a^2 + b^2)*d)]
    @test_int [x^0/(a + b*tan(c + d*x^2)), x, 0, Unintegrable((a + b*tan(c + d*x^2))^(-1), x)]
    @test_int [1/(x*(a + b*tan(c + d*x^2))), x, 0, Unintegrable(1/(x*(a + b*tan(c + d*x^2))), x)]
    @test_int [1/(x^2*(a + b*tan(c + d*x^2))), x, 0, Unintegrable(1/(x^2*(a + b*tan(c + d*x^2))), x)]


    @test_int [x^3/(a + b*tan(c + d*x^2))^2, x, 6, -(x^4/(4*(a^2 + b^2))) + (b + 2*a*d*x^2)^2/(8*a*(a + im*b)*(a^2 + b^2)*d^2) + (b*(b + 2*a*d*x^2)*log(1 + ((a^2 + b^2)*ℯ^(2*im*(c + d*x^2)))/(a + im*b)^2))/(2*(a^2 + b^2)^2*d^2) - (im*a*b*PolyLog(2, -(((a^2 + b^2)*ℯ^(2*im*(c + d*x^2)))/(a + im*b)^2)))/(2*(a^2 + b^2)^2*d^2) - (b*x^2)/(2*(a^2 + b^2)*d*(a + b*tan(c + d*x^2)))]
    @test_int [x^2/(a + b*tan(c + d*x^2))^2, x, 0, Unintegrable(x^2/(a + b*tan(c + d*x^2))^2, x)]
    @test_int [x^1/(a + b*tan(c + d*x^2))^2, x, 4, ((a^2 - b^2)*x^2)/(2*(a^2 + b^2)^2) + (a*b*log(a*cos(c + d*x^2) + b*sin(c + d*x^2)))/((a^2 + b^2)^2*d) - b/(2*(a^2 + b^2)*d*(a + b*tan(c + d*x^2)))]
    @test_int [x^0/(a + b*tan(c + d*x^2))^2, x, 0, Unintegrable((a + b*tan(c + d*x^2))^(-2), x)]
    @test_int [1/(x*(a + b*tan(c + d*x^2))^2), x, 0, Unintegrable(1/(x*(a + b*tan(c + d*x^2))^2), x)]
    @test_int [1/(x^2*(a + b*tan(c + d*x^2))^2), x, 0, Unintegrable(1/(x^2*(a + b*tan(c + d*x^2))^2), x)]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*tan(c+d*x^(1/2)))^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^3*(a + b*tan(c + d*sqrt(x))), x, 13, (a*x^4)/4 + (im/4)*b*x^4 - (2*b*x^(7/2)*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d + ((7*im)*b*x^3*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 - (21*b*x^(5/2)*PolyLog(3, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^3 - (((105*im)/2)*b*x^2*PolyLog(4, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^4 + (105*b*x^(3/2)*PolyLog(5, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^5 + (((315*im)/2)*b*x*PolyLog(6, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^6 - (315*b*sqrt(x)*PolyLog(7, -ℯ^((2*im)*(c + d*sqrt(x)))))/(2*d^7) - (((315*im)/4)*b*PolyLog(8, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^8]
    @test_int [x^2*(a + b*tan(c + d*sqrt(x))), x, 11, (a*x^3)/3 + (im/3)*b*x^3 - (2*b*x^(5/2)*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d + ((5*im)*b*x^2*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 - (10*b*x^(3/2)*PolyLog(3, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^3 - ((15*im)*b*x*PolyLog(4, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^4 + (15*b*sqrt(x)*PolyLog(5, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^5 + (((15*im)/2)*b*PolyLog(6, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^6]
    @test_int [x^1*(a + b*tan(c + d*sqrt(x))), x, 9, (a*x^2)/2 + (im/2)*b*x^2 - (2*b*x^(3/2)*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d + ((3*im)*b*x*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 - (3*b*sqrt(x)*PolyLog(3, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^3 - (((3*im)/2)*b*PolyLog(4, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^4]
    @test_int [a + b*tan(c + d*sqrt(x)), x, 6, a*x + im*b*x - (2*b*sqrt(x)*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d + (im*b*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^2]
