    @test_int [(a + b*tan(c + d*sqrt(x)))/x^2, x, 2, -(a/x) + b*Unintegrable(tan(c + d*sqrt(x))/x^2, x)]


    @test_int [x^2*(a + b*tan(c + d*sqrt(x)))^2, x, 20, ((-2*im)*b^2*x^(5/2))/d + (a^2*x^3)/3 + ((2*im)/3)*a*b*x^3 - (b^2*x^3)/3 + (10*b^2*x^2*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 - (4*a*b*x^(5/2)*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d - ((20*im)*b^2*x^(3/2)*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^3 + ((10*im)*a*b*x^2*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 + (30*b^2*x*PolyLog(3, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^4 - (20*a*b*x^(3/2)*PolyLog(3, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^3 + ((30*im)*b^2*sqrt(x)*PolyLog(4, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^5 - ((30*im)*a*b*x*PolyLog(4, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^4 - (15*b^2*PolyLog(5, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^6 + (30*a*b*sqrt(x)*PolyLog(5, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^5 + ((15*im)*a*b*PolyLog(6, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^6 + (2*b^2*x^(5/2)*tan(c + d*sqrt(x)))/d]
    @test_int [x^1*(a + b*tan(c + d*sqrt(x)))^2, x, 16, ((-2*im)*b^2*x^(3/2))/d + (a^2*x^2)/2 + im*a*b*x^2 - (b^2*x^2)/2 + (6*b^2*x*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 - (4*a*b*x^(3/2)*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d - ((6*im)*b^2*sqrt(x)*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^3 + ((6*im)*a*b*x*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 + (3*b^2*PolyLog(3, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^4 - (6*a*b*sqrt(x)*PolyLog(3, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^3 - ((3*im)*a*b*PolyLog(4, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^4 + (2*b^2*x^(3/2)*tan(c + d*sqrt(x)))/d]
    @test_int [x^0*(a + b*tan(c + d*sqrt(x)))^2, x, 10, a^2*x + (2*im)*a*b*x - b^2*x - (4*a*b*sqrt(x)*log(1 + ℯ^((2*im)*(c + d*sqrt(x)))))/d + (2*b^2*log(cos(c + d*sqrt(x))))/d^2 + ((2*im)*a*b*PolyLog(2, -ℯ^((2*im)*(c + d*sqrt(x)))))/d^2 + (2*b^2*sqrt(x)*tan(c + d*sqrt(x)))/d]
    @test_int [(a + b*tan(c + d*sqrt(x)))^2/x^1, x, 0, Unintegrable((a + b*tan(c + d*sqrt(x)))^2/x, x)]
    @test_int [(a + b*tan(c + d*sqrt(x)))^2/x^2, x, 0, Unintegrable((a + b*tan(c + d*sqrt(x)))^2/x^2, x)]


