    #=p<0=#


    @test_int [x^3/(a + b*tan(c + d*sqrt(x))), x, 11, x^4/(4*(a + im*b)) + (2*b*x^(7/2)*log(1 + ((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2))/((a^2 + b^2)*d) - (7*im*b*x^3*PolyLog(2, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^2) + (21*b*x^(5/2)*PolyLog(3, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^3) + (105*im*b*x^2*PolyLog(4, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/(2*(a^2 + b^2)*d^4) - (105*b*x^(3/2)*PolyLog(5, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^5) - (315*im*b*x*PolyLog(6, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/(2*(a^2 + b^2)*d^6) + (315*b*sqrt(x)*PolyLog(7, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/(2*(a^2 + b^2)*d^7) + (315*im*b*PolyLog(8, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/(4*(a^2 + b^2)*d^8)]
    @test_int [x^2/(a + b*tan(c + d*sqrt(x))), x, 9, x^3/(3*(a + im*b)) + (2*b*x^(5/2)*log(1 + ((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2))/((a^2 + b^2)*d) - (5*im*b*x^2*PolyLog(2, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^2) + (10*b*x^(3/2)*PolyLog(3, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^3) + (15*im*b*x*PolyLog(4, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^4) - (15*b*sqrt(x)*PolyLog(5, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^5) - (15*im*b*PolyLog(6, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/(2*(a^2 + b^2)*d^6)]
    @test_int [x^1/(a + b*tan(c + d*sqrt(x))), x, 7, x^2/(2*(a + im*b)) + (2*b*x^(3/2)*log(1 + ((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2))/((a^2 + b^2)*d) - (3*im*b*x*PolyLog(2, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^2) + (3*b*sqrt(x)*PolyLog(3, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/((a^2 + b^2)*d^3) + (3*im*b*PolyLog(4, -(((a^2 + b^2)*ℯ^(2*im*(c + d*sqrt(x))))/(a + im*b)^2)))/(2*(a^2 + b^2)*d^4)]
